import React from 'react';
import Mydic from './myDic';
import AddWord from './AddWord';

function App() {
  return (
    <div className="App">
      <h1>MY DICTIONARY</h1>
      <Mydic></Mydic>
      <AddWord></AddWord>
    </div>
  );
}

export default App;
